import React, { Component } from "react";
import Slider from "react-slick";

export default class AsNavFor extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nav1: null,
      nav2: null
    };
  }

  componentDidMount() {
    this.setState({
      nav1: this.slider1,
      nav2: this.slider2
    });
  }

  render() {
    return (
      <div>
        <h2>Slider Syncing (AsNavFor)</h2>
        <h4>First Slider</h4>
        <Slider
          asNavFor={this.state.nav2}
          ref={slider => (this.slider1 = slider)}
        >
          {
                        clientCardDate.map((data, i)=>{
                            console.log(data);
                            return(
                                <ClientCard img={data.image} text={data.text} text1={data.text1}/>
                            );
                        })
                    }
        </Slider>

        <ul class="slider-nav">
            <Slider asNavFor={this.state.nav1} ref={slider => (this.slider2 = slider)} slidesToShow={5} swipeToSlide={true} focusOnSelect={true}  centerMode={true} centerPadding={"20px"}>
                <li>
                    <img src="assets/images/user1.png" alt=""/>
                </li>

                <li>
                    <img src="assets/images/user2.png" alt=""/>
                </li>

                <li>
                    <img src="assets/images/user3.png" alt=""/>
                </li>

                <li>
                    <img src="assets/images/user4.png" alt=""/>
                </li>

